import styled from "styled-components";

const StyledForm = styled.div`
    margin: 5rem 1rem;
    padding: 1rem;

    section{
        display: flex;
        flex-direction: column;
    }

    img{
        max-width: 100%;
        border: 10px;
        height: auto;
    }

    .form_left{
        display: none;
    }

`;
export default StyledForm;
